import React, {Component} from 'react';
import Header from './header';
import Footer from './footer';

const TESTS = 'http://localhost:3004/tests';

const generateQuiz = ({props}) => {
    if (props) {
        console.log(props);
        return (
            <div className="row">
                This is our test
            </div>
        )
    }
}

class Test extends Component {
    constructor (props) {
        super (props);
        this.state = {
            data: ''
        }
    }

    componentDidMount () {
        fetch ({TESTS}, {method: 'GET'})
        .then (response => response.json())
        .then (json => {
            console.log(json);
            this.setState = {
                data: json
            }
        })
    }

    render() {
        console.log(this.props);
        return (
            <div>
                <Header />
                {generateQuiz(this.props)}
                <Footer />
            </div>
        )
    }
}

export default Test;
